import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Vaccination Tracker</h1>
        <Routes>
          {/* Add your routes here */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
